import './App.css';
import FormularioArma from './FormularioArma';
import LoginAdmin from './LoginAdmin';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

function App() {
  return (
    <Router>
      <div className="App">
        <Routes>
          <Route path="/admin" element={<LoginAdmin onLogin={() => window.location.reload()} />} />
          <Route path="/" element={<FormularioArma />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
